import React from 'react';
import './App.css';
import HomePage from './pages/HomePage';

function App() {
  return (
    <div 
      className="App"
      style={{ backgroundImage: `url(${process.env.PUBLIC_URL + '/background.png'})` }}
    >
      <HomePage />
    </div>
  );
}

export default App;
